import React from "react";

export default function Home(){
    return (
        <div>
            <div>
                <h1>Welcome to my portfolio webpage!</h1>
                <p>Please excuse the appearance as this is a current work in progress. Feel free become aquainted with me. I will be using this webpage as a central destination to showcase my work, experience, and projects.</p>
            </div>
            <div>
            <img
                src="https://res.cloudinary.com/dow8www4d/image/upload/v1642611366/Store/about.jpg"
                height="275"
                width="183"
                className="rounded"
                alt=""
              />
            </div>
        </div>
    );
}
